import Profile from "./Profile/Profile";
import user from "./User/user.json";


function App() {
  return (<div>
      <Profile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    
    </div>
  );
}

export default App;
